export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},"5ocdTHXFNE":{data:{id:2592,attributes:{imdbId:"tt0059798",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZDQyOTA4ZTItYzJhMy00ZjA0LWEwYWEtYTdhNGE1ZDgxOWNiXkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"7.4\u002F10"},{Source:"Rotten Tomatoes",Value:"71%"}],item_lang:{data:{id:3255,attributes:{title:d,plot:"12-year-old Nick lives with his Uncle Murray, a Mr. Micawber-like Dickensian character who keeps hoping something won't turn up. What turns up is a social worker who falls in love with Murray and a bit in love with Nick. As the child-welfare people try to force Murray to become a conventional man (the price they demand for allowing him to keep Nick), the nephew, who until now has gloried in his uncle's iconoclastic approach to life, tries to play mediator. But when he succeeds, he is alarmed by the uncle's willingness to cave in to society in order to save the relationship.",slug:"a-thousand-clowns"}}},books:{data:[{id:1582,attributes:{title:d,description:"Herb Gardner Comedy Characters: 4 male, 1 female, 12 year-old boy 2 Interior scenes This benchmark of Broadway comedy produced one of the theatre's most beloved roles: unconventional Murray, uncle to precocious nephew, Nick. Tired of writing cheap comedy gags for \"Chipper the Chipmunk,\" a children's television star, Murray finds himself unemployed with plenty of free time with which to pursue his...pursuits. Lectured by his conventional brother Arnold and hounded by \"the system,\" Murray is paid a visit by bickering, uptight social workers, Sandra and Albert, and finds himself solving their problems as well as most of his own. \"Would be a standout comedy in any season. Filled with laughter and warmth and sweetness and inspired daffiness. One of the quintessential New York comedies.\"-New York Daily News \"An extraordinarily funny play with some brilliantly offbeat lines.\"-The New York Post",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=CcjCQnBFk0cC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:g,publisher:"Samuel French Trade",subtitle:"A Comedy in Three Acts"}},{id:1583,attributes:{title:d,description:"This play tells the story of an unconventional man who is forced to get a conventional job in order to take care of his young nephew who lives with him. The story is complicated further when a social worker is assigned to their case.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ciMyAAAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:g,publisher:"Random House Trade",subtitle:"A New Comedy"}},{id:1584,attributes:{title:a,description:"(Applause Books). Here, gathered for the first time, is the highly lauded work of one of America's most beloved playwrights. Introductory essays to each work by some of theatre's most distinguished artists give historical and critical perspective to Gardner's achievement. Includes: A THOUSAND CLOWNS * THE GOODBYE PEOPLE * THIEVES * I'M NOT RAPPAPORT * CONVERSATIONS WITH MY FATHER * WHO IS HARRY KELLERMAN AND WHY IS HE SAYING THOSE TERRIBLE THINGS ABOUT ME'.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ov1ZAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2000-01-01",publisher:"Applause Books",subtitle:"The Collected Plays and the Screenplay Who is Harry Kellerman and why is He Saying Those Terrible Things about Me?"}},{id:1585,attributes:{title:"The Big Picture",description:"(Applause Books). William Goldman, who holds two Academy Awards for his screenwriting ( Butch Cassidy and the Sundance Kid and All the President's Men ), and is author of the perennial best seller Adventures in the Screen Trade , scrutinizes the Hollywood movie scene of the past decade in this engaging collection. With the film-world-savvy and razor-sharp commentary for which he is known, he provides an insider's take on today's movie world as he takes a look at \"the big picture\" on Hollywood, screenwriting, and the future of American cinema. Paperback.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=AOsfAQAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["William Goldman",a],firstBook:c,published:"2001-01-01",publisher:"Applause Theatre & Cinema",subtitle:"Who Killed Hollywood? and Other Essays"}},{id:1586,attributes:{title:"A Thousand Clowns ; Thieves ; The Goodbye People",description:"A THOUSAND CLOWNS: Murray Burns (formerly of the Chuckles the Chipmunk show) and his precocious nephew Nick, have a far from humdrum life together- until two social workers come to investigate. Can Murray, a lovable nonconformist, straighten up and do right by the kid he loves? You bet.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=aPzyAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"1979-01-01",publisher:h,subtitle:h}}]}}},meta:{}}},prerenderedAt:1681309119622}}("Herb Gardner","movie",null,"A Thousand Clowns","series",1,"1962-01-01",""))